import React from "react";
import "./Chart.css";
import ChartBar from "./ChartBar";

const Chart = (props) => {
  return (
    <div className="chart">
      {props.dataPoints.map((dataPoints) => (
        <ChartBar value={dataPoints.value} maxValue={null} lable={dataPoints.lable} key={dataPoints.lable}/>
      ))}
    </div>
  );
};

export default Chart;
